import React from 'react';
import { Helmet } from 'react-helmet';
import Header from '../../components/Header';

export default function Services() {
  return (
    <main style={{ color: 'white', minHeight: '100vh', background: '#181B20', fontFamily: 'sans-serif' }}>
      <Helmet>
        <title>Services - NovaWeb | Solutions Web Professionnelles</title>
        <meta name="description" content="Découvrez nos services de développement web : sites vitrines, e-commerce, applications web sur mesure. Des solutions adaptées à vos besoins." />
        <meta name="keywords" content="services web, développement web, sites vitrines, e-commerce, applications web" />
      </Helmet>
      <Header />
      <section style={{ maxWidth: 900, margin: '0 auto', padding: '60px 20px 40px 20px', textAlign: 'center' }}>
        <h1 style={{ fontSize: 38, fontWeight: 700, marginBottom: 20 }}>Nos Services</h1>
        <p style={{ fontSize: 20, color: '#b0b8c1', maxWidth: 600, margin: '0 auto' }}>
          Des solutions web sur mesure pour concrétiser vos ambitions digitales.
        </p>
      </section>
      <footer style={{ borderTop: '1.5px solid #23262B', padding: 32, color: '#888', fontSize: 14, marginTop: 40 }}>
        © 2024 NovaWeb. Tous droits réservés.
      </footer>
    </main>
  );
}
